export default function ExpenseDate(date) {
  const { log } = console;
  log(date);
  const MONTH = date.date.toLocaleString('en-US', { month: 'long' });
  const DAY = date.date.toLocaleString('en-US', { day: '2-digit' });
  const YEAR = date.date.getFullYear();

  return (
    <div>
      <div>{MONTH}</div>
      <div>{YEAR}</div>
      <div>{DAY}</div>
    </div>
  );
}
